def unusual_addition(lst: list) -> list:
    """"""
    results = []
    for string in lst:
        total_odd = 0
        for char in string:
            if int(char) % 2 != 0:
                total_odd += 1
        total_odd_squared = total_odd ** 2
        results.append(str(total_odd_squared))
    return results
